import React from "react";

import ReactDOM from "react-dom/client";
import { BrowserRouter } from "react-router-dom";
import App from "./App";

import { store } from "./redux/store";
import { Provider } from "react-redux";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <BrowserRouter>
    <Provider store={store}>
      <h1>Lorem ipsum dolor sit amet consectetur adipisicing elit. Minus dolore velit eos placeat sit officia voluptatibus, dolor facilis iste culpa saepe quo officiis quidem praesentium cumque fuga aut porro ut.</h1>
      <App />
    </Provider>
  </BrowserRouter>
);
